import React from 'react';

const DashboardVendedor = () => {
  // Dados de exemplo para a lista de produtos mais acessados
  const produtosMaisAcessados = [
    { id: 1, nome: 'Produto A', acessos: 150 },
    { id: 2, nome: 'Produto B', acessos: 120 },
    { id: 3, nome: 'Produto C', acessos: 95 },
  ];

  return (
    <div>
      <h1>Painel do Vendedor</h1>
      <p>Bem-vindo ao seu painel! Gerencie seus produtos e acompanhe seu desempenho.</p>

      <hr />

      {/* Seção de Gerenciamento de Produtos */}
      <section>
        <h2>Gerenciamento de Produtos</h2>
        <button>Cadastrar Novo Produto</button>
        <button>Ver Meus Produtos</button>
      </section>

      <hr />

      {/* Seção de Análise */}
      <section>
        <h2>Produtos Mais Acessados</h2>
        <ul>
          {produtosMaisAcessados.map(produto => (
            <li key={produto.id}>
              {produto.nome} - <strong>{produto.acessos} visualizações</strong>
            </li>
          ))}
        </ul>
      </section>

      <hr />

      {/* Seção de Conta */}
      <section>
        <h2>Minha Conta</h2>
        <button>Editar Perfil e Dados da Loja</button>
        <p><small>Obs: A alteração de dados como CNPJ requer aprovação de um administrador.</small></p>
      </section>
    </div>
  );
};

export default DashboardVendedor;
